import React from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import { Container, Row, Col, Image } from "react-bootstrap";
import "./index.css";
import twitterContainer from "./clipart-2-13-12-55-41.png";

function SplashPage() {
  return (
    <Container className="d-inline container">
      <br />
      <br />
      <br />
      <Row>
        <Col >
        <h1 className="ml-auto" id="header-text">Welcome To Twitter Search Api</h1>
        <Image className="inline-block twitter-logo" src={twitterContainer} />
        </Col>
      </Row>
    </Container>
  );
}

export default SplashPage;
